import React from 'react'

import { cardData } from '../../cardData'

console.log('cardData', cardData)
export const Box = () => {
  cardData.map((card)=> {
    return (
      <section>
        <div>
          <p>Buy ${card.amount}</p>
          <p></p>
        </div>
      </section>
    )
})}
